import React from 'react';
import '../App.css';
import Tab from './Tab';

class InterestArea extends React.Component {

getInterests() {
    let interests = [];

    for(let i = 0; i < this.props.interests.length; i++) {
      interests.push (
        <Tab title={this.props.interests[i]}/>
      )
    }

    return interests;
  }

  render() {
    return (

      <div class="container-fluid">
        <div class="row">
          <div class="col-lg-6" >{this.getInterests()}</div>
        </div>
      </div>

    )
  }
}

export default InterestArea;
